const BasicMenu = () => {
    
    return(
        <div>
            <header>
                <p1 class="text 3xl font-bold underline">로고</p1>
                <label for="searchMain">검색창</label>
                <input type="text" id="searchMain" placeholder="검색어를 입력하세요"></input>
                <button id="btnSearch">검색</button>
                <button id="btnLogin">로그인</button>
            </header>
            <nav>
                <ul>
                    <li>홈</li>
                    <li>마이페이지</li>
                </ul>
            </nav>
        </div>
    );
    
}
export default BasicMenu;
